() => {
  var formobject = {};
  formobject['formheader'] = [];
  return Input_Workorder.__evaluation__.evaluatedValues.label;
  Ordertype == 'Project' ? formobject['formheader'].push({
    "label": SelectProject.selectedOptionLabel,
    "value": SelectProject.selectedOptionValue
  }) : formobject['formheader'].push({
    "label": "Werkbon",
    "value": Input_Workorder.inputText
  });
  formobject['formheader'].push({
    "label": "Klantnaam",
    "value": Input_WorkorderDescription.inputText
  });
  formobject['formheader'].push({
    "label": SelectProject.selectedOptionLabel,
    "value": SelectProject.selectedOptionValue
  });
  formobject['formheader'].push({
    "label": "",
    "value": SelectProject.selectedOptionValue
  });
  formobject['questions'] = [];
  Table_Questions.updatedRows.forEach(question => formobject['questions'].push(question.allFields));
  formobject['remarks'] = [];
  Table_Remarks.updatedRows.forEach(remark => formobject['remarks'].push(remark.allFields));
  return formobject;
}

